import React from 'react';
import Form from 'react';
import './App.css';

function App() {
  return (
    <div className="Login">
   <Form>
     <Form.Group controlId = "">
       <Form.Label>
         UserName
       </Form.Label>
       <Form.Control type="UserName" placeholder="enter your username"></Form.Control>
     </Form.Group>
   </Form>
    </div>
  );
}

export default App;
